  false,\n\t\"url\": null,\n\t\"notes\": \"The ionosphere is that part of the Earth's
  atmosphere that results mainly from the photo ionization of the upper atmosphere.
  Traditionally, the following ionospheric regions and their approximate height ranges
  have been designated: D region (60-90 km); E region (90-150 km); F1 region (150-250
  km); and F2 region (above 250 km). Ionosondes utilize the radio wave-reflecting
  properties of the ionosphere. The product of the speed of light in a vacuum and
  half then                    elapsed time between vertical transmission of a single
  frequency electromagnetic wave and reception of the reflected wave at the transmitting
  location is defined as the virtual height of that frequency. A sweep-frequency ionogram
  is a plot of virtual height versus frequency and is recorded as instantaneously
  as possible. These ionospheric data consist mainly of hourly values for at least
  one of the following characteristics: foF2, M(3000)F2, hF2, foF1, M(3000)F1, hF,
  foE, hE,n                    foE2, hE2, foEs, fbEs, hEs, fmI, and fxI. The values
  are five byte (character) fields. The first three bytes of the field are reserved
  for a numeric value; the last two bytes are reserved for the qualifying and descriptive
  letter, if present. There are no decimals encoded in these data. Documentation is
  included. There are two CD-ROM's worth of data. One contains 1957 - 1975 data; the
  other contains 1976-1990 data. ASCII data files and a DOS-compatible application
  isn                    included.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
